<script>
document.addEventListener('DOMContentLoaded', (event) => {
    const nodes = document.querySelectorAll('.node-group path, .node-group text'); // Adjust the selector to target only the nodes and text elements within the group

    nodes.forEach(node => {
        node.addEventListener('click', function() {
            // Get the parent group of the clicked node
            const group = this.parentNode;
            const groupId = group.id;
            const isNodeHighlighted = this.classList.contains('highlighted');
            
            // Remove the 'highlighted' class from all individual elements
            document.querySelectorAll('.highlighted').forEach(highlight => {
                highlight.classList.remove('highlighted');
            });

            // If the clicked node wasn't already highlighted, add the 'highlighted' class to its elements
            if (!isNodeHighlighted) {
                // Highlight all individual elements in the node's group
                group.querySelectorAll('*').forEach(element => {
                    element.classList.add('highlighted');
                });

                // Highlight all individual elements in the corresponding edges group
                const edgesGroup = document.getElementById(groupId + '-edges');
                if (edgesGroup) {
                    edgesGroup.querySelectorAll('*').forEach(element => {
                        element.classList.add('highlighted');
                    });
                }
            }
        });
    });

    const edges = document.querySelectorAll('.edge-group path');
    edges.forEach(edge => {
        edge.classList.add("basic")
